import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar';
import Productlist from './Components/ProductList';

function App() {
  const productList = [
    {
      Name: "Iphone XS Max",
      Price: "Aukat se Bahar",
      Quantity: 90
    },
    {
      Name: "Iphone 11 Max",
      Price: "Yeh bhi Aukat se Bahar",
      Quantity: 0
    }
  ]
  return (
    <>
      <Navbar/>
      <main>
        <ProductList productList = {productList}/>
      </main>
    </>
  );
}

export default App;
